function tpgbscrollParallex(e){let o=e.querySelectorAll(".tpgb-section:not(.tpgb-section-editor),.tpgb-container-row:not(.tpgb-container-row-editor)");o&&o.forEach(e=>{var o,r;e.classList.contains("tpgb-scroll-parallax")&&(o=new ScrollMagic.Controller,r=e.querySelector(".img-scroll-parallax"),new ScrollMagic.Scene({triggerElement:e,triggerHook:1,duration:"200%"}).setTween(TweenMax.fromTo(r,1,{backgroundPositionY:"15%",ease:"Power0.easeNone"},{backgroundPositionY:"85%",ease:"Power0.easeNone"})).addTo(o))})}document.addEventListener("DOMContentLoaded",()=>{tpgbscrollParallex(document)});